                "content": "The training you are receiving is a foundational step in eliminating failures in exterior shells. This training will focus on sound design and construction principles along with reliable, weather-resistant construction and will include building exterior shell maintenance. This training will also cover the different materials you will be dealing with, how they are used, and how certain types of equipment differ from other types.\n",
